import './List.css';
import ListItem from '../listItem/ListItem';


const List = ({task}) => {
    const elem = task.map(i => <ListItem key={i.id} i={i}/>)
    return(
        
            <ul>
                <ListItem />
                
            </ul>
        
    )
}

export default List
